import React from 'react';
import SubscriptionPlan from './SubscriptionPlan';

const plans = [
  {
    id: 1,
    title: 'Plano Básico',
    price: 'R$ 19,90/mês',
    features: ['1 tela', 'Sem HD', 'Cancelamento a qualquer momento']
  },
  {
    id: 2,
    title: 'Plano Padrão',
    price: 'R$ 29,90/mês',
    features: ['2 telas simultâneas', 'HD disponível', 'Cancelamento a qualquer momento']
  },
  {
    id: 3,
    title: 'Plano Premium',
    price: 'R$ 39,90/mês',
    features: ['4 telas simultâneas', 'HD e Ultra HD disponíveis', 'Cancelamento a qualquer momento']
  }
];

const SubscriptionPlans = () => {
  return (
    <div style={{ display: 'flex' }}>
      {plans.map((plan) => {
        return (
          <SubscriptionPlan
            key={plan.id}
            title={plan.title}
            price={plan.price}
            features={plan.features}
          />
        );
      })}
    </div>
  );
};

export default SubscriptionPlans
